#include <bits/stdc++.h>
using namespace std;
 
long long int find(int n, vector<int> a){
    int count = 0;
    vector<int> v;
    for(int i = 2; i<=200; i++) {
        bool f = false;
        for(int j = 2; j*j<=i; j++) {
            if(i%j==0) {
                f=true;
                break;
            }
        }
        if(f)continue;
        count++;
        v.push_back(i);
    }
 
 
    int ans = 0;
    bool f = true;
    map<long long int , int> m;
    string s;
    for(int i = 0; i<count; i++)s.push_back('0');
    m[0]++;
    for(int i=0; i < n; i++){
        for(int j = 0; j<count; j++) {
            int cnt = 0;
            while(a[i]%v[j]==0) {
                cnt++;
                a[i]/=v[j];
            }
            if(s[j]=='1')cnt++;
            s[j] = cnt%2+'0';
        }
        long long int temp = 0;
        for(auto &x : s) {
            temp*=2;
            if(x=='1')temp++;
        }
        ans+=m[temp];
        m[temp]++;
    }
    return ans;
}
int main(){
    int n;
    cin>>n;
    vector<int> a(n);
    for(auto &x : a)cin>>x;
    cout<<find(n, a);
    return 0;
}

