// ttl cache: 
#include <bits/stdc++.h>
using namespace std;

vector<int> processEventIntervals(vector<vector<int>> &data, vector<int> &queries){
    map<int, int> m;
    for(auto &x : data){
        m[x[0]]++;
        m[x[1]+x[0]+1]--;
    }
    int curr=0;
    vector<int> keys;
    for(auto &x : m){
        keys.push_back(x.first);
        curr+=x.second;
        m[x.first]=curr;
    }
    vector<int> ans;
    for(auto &x : queries){
        int lo=0 , hi=keys.size()-1 , mid;
        while(lo<=hi)
        {
            mid=(lo+hi)/2;
            if(keys[mid]<=x)
            {
                lo=mid+1;
            }
            else
            {
                hi=mid-1;
            }
        }   
        if(hi==-1){
            ans.push_back(0);
        }else{
            ans.push_back(m[keys[hi]]);
        }
    }
    
    // cout<<m[keys.back()-2];
    return ans;
}
int main(){
    int n;
    cin>>n;
    vector<vector<int>> data(n, vector<int>(2));
    for(auto &x : data){
        cin>>x[0]>>x[1];
    }
    int m;
    cin>>m;
    vector<int> q(m);
    for(auto &x : q)cin>>x;
    auto ans =processEventIntervals(data, q);
    for(auto &x : ans)cout<<x<<" ";
    return 0;
}


