#include <bits/stdc++.h>
using namespace std;

// Function to count minimum number
// of bits required to be flipped
// to make all array elements equal
int makeEqual(int* arr, int n)
{
	// Stores the count of unset bits
	int fre0[33] = { 0 };

	// Stores the count of set bits
	int fre1[33] = { 0 };

	// Traverse the array
	for (int i = 0; i < n; i++) {

		int x = arr[i];

		// Traverse the bit of arr[i]
		for (int j = 0; j < 33; j++) {

			// If current bit is set
			if (x & 1) {

				// Increment fre1[j]
				fre1[j] += 1;
			}

			// Otherwise
			else {

				// Increment fre0[j]
				fre0[j] += 1;
			}

			// Right shift x by 1
			x = x >> 1;
		}
	}

	// Stores the count of total moves
	int ans = 0;

	// Traverse the range [0, 32]
	for (int i = 0; i < 33; i++) {

		// Update the value of ans
		ans += min(fre0[i], fre1[i]);
	}

	// Return the minimum number of
	// flips required
	return ans;
}

// Driver Code
int main()
{
	int arr[] = { 3, 5 };
	int N = sizeof(arr) / sizeof(arr[0]);
	cout << makeEqual(arr, N);

	return 0;
}

function solve (password) {

    let isValid = true;

    if (password.length < 6 || password.length > 10) {
        console.log(`Password must be between 6 and 10 characters`);
        isValid = false;
    } 

    if (countOfInvalidChars(password) > 0) {
        console.log(`Password must consist only of letters and digits`);
        isValid = false;
    } 


    if (countDigits(password) < 2) {
        console.log(`Password must have at least 2 digits`);
        isValid = false;
    }

    if(isValid) {
        console.log(`Password is valid`);
    }


    function countOfInvalidChars(password) {
        let alphanumericArray = [];
        let invalidChars = 0;

       
        for (let i = 48; i <= 57; i++) {
            alphanumericArray.push(String.fromCharCode(i));
        }

        for (let i = 65; i <= 90; i++) {
            alphanumericArray.push(String.fromCharCode(i));
        }

        for (let i = 97; i <= 122; i++) {
            alphanumericArray.push(String.fromCharCode(i));
        }

        for (let i = 0; i < password.length; i++) {
            let char = password[i];

            if (!alphanumericArray.includes(char)) {
                invalidChars++;
            }
        }

        return invalidChars;
    }
    




    function countDigits(password) {
        let count = 0;
    
        for (let i = 0; i < password.length; i++) {
            let char = password[i];
            let code = char.charCodeAt(0);
    
            if (code >= 48 && code <= 57) {
                count++;
            }
        }
    
        return count;
    }
}

